public V remove(K k) {
  int index = getElementIndex(k);
  if (index < 0) {
    return null;
  }
  V val = (V)buffer[1 + (2 * index)];
  buffer[2 * index] = null;
  buffer[1 + (2 * index)] = null;
  numInserted--;
  return val;
}
